import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import ListItemText from '@material-ui/core/ListItemText';
import ListItem from '@material-ui/core/ListItem';
import List from '@material-ui/core/List';
import Divider from '@material-ui/core/Divider';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import IconButton from '@material-ui/core/IconButton';
import Typography from '@material-ui/core/Typography';
import CloseIcon from '@material-ui/icons/Close';
import Slide from '@material-ui/core/Slide';
import TextField from '@material-ui/core/TextField';
const useStyles = makeStyles((theme) => ({
    root: {
        width: '40vw',
        height: '100%',
        margin: 0,
        maxWidth: '100%',
        maxHeight: '100%',
        borderRadius: 0 ,
        }
        ,


  appBar: {
    position: 'relative',
  },
  title: {
    marginLeft: theme.spacing(2),
    flex: 1,
  },
  btn:{       
    margin:'auto', 
    marginBottom: '20px'
},
}));

const Transition = React.forwardRef(function Transition(props, ref) {
  return <Slide direction="left" ref={ref} {...props} />;
});

const TurnoForm = ({open , setOpen}) => {
  const classes = useStyles();

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div  className={classes.root} >
        <Button className={classes.btn} variant="contained" color="primary"   onClick={handleClickOpen}>Reservar Turno</Button>

      <Dialog  className={classes.root}  fullScreen open={open} onClose={handleClose} TransitionComponent={Transition}>
        <AppBar className={classes.appBar}>
          <Toolbar>
            <IconButton edge="start" color="inherit" onClick={handleClose} aria-label="close">
              <CloseIcon />
            </IconButton>
            <Typography variant="h6" className={classes.title}>
              Reservar Turno
            </Typography>
            <Button autoFocus color="inherit" onClick={handleClose}>
              save
            </Button>
          </Toolbar>
        </AppBar>
        <List>
          <ListItem button>
          <TextField required id="standard-required" label="Nombres" 
              secondary="Este campo es requerido" />
           </ListItem>

           <ListItem button>
          <TextField required id="standard-required" label="Apellidos" 
              secondary="Este campo es requerido" />
           </ListItem>
           <ListItem button>
          <TextField required id="standard-required" label="DNI" 
              secondary="Este campo es requerido" />
           </ListItem>
           <ListItem button>
          <TextField required id="standard-required" label="Nro de Celular" 
              secondary="Este campo es requerido" />
           </ListItem>
           <ListItem button>
          <TextField required id="standard-required" label="email" 
              secondary="Este campo es requerido" />
           </ListItem>
        </List>
      </Dialog>
    </div>
  );
}
export default TurnoForm;
